            <>
                {
                    newsitem.map((item) => {
                        <Card>
                            <CardHeader>
                                <h5>{item.title}</h5>
                            </CardHeader>
                            <CardImg src={item.urlToImage}/>
                            <CardBody>
                                <p>{item.description}</p>
                            </CardBody>
                            <CardFooter>
                                <caption>
                                    {item.author} <br/>
                                    {item.publishedAt}
                                </caption>
                                <Button variant="primery" href={item.url}>View More</Button>
                            </CardFooter>
                        </Card>
                    })
                }
            </>
        );
}

export default NewsCard;
